exports.setIntegerParameter=function(e,t,n){if(e[t]==null)e[t]=n;else if(typeof e[t]!="number"&&e[t]!==parseInt(e[t],10))throw"object field ["+t+"] must be a numeric integer value, attempted to set to ["+e[t]+"] type of ["+typeof e[t]+"]"},exports.setBooleanParameter=function(e,t,n){if(e[t]==null)e[t]=n;else if(typeof e[t]!="boolean")throw"object field ["+t+"] must be a boolean value, attempted to set to ["+e[t]+"] type of ["+typeof e[t]+"]"},exports.setStringParameter=function(e,t,n){if(e[t]==null)e[t]=n;else if(typeof e[t]!="string")throw"object field ["+t+"] must be a string value, attempted to set to ["+e[t]+"] type of ["+typeof e[t]+"]"};